import { httpService } from "./";
import { apiUrl } from "../config";

export const contactUsService = {
    contactUsForm,
};

const apiEndpoint = apiUrl + "/contactUs";

function contactUsForm(contactUs) {
  return httpService.post(`${apiEndpoint}/`,contactUs);
}
